# app/main.py
import streamlit as st
from admin.admin_routes import admin_login, admin_home
from user.user_routes import user_home
add= "data:image/png;base64,"
def main():
    st.sidebar.title("Navigation")
    selected_page = st.sidebar.radio("Go to", ["Home", "Admin"])
    image_url = add
    image_width = 300
    image_height = 200
    st.markdown(f"![Image]({image_url})", unsafe_allow_html=True)    
    if selected_page == "Home":
        user_home()
    elif selected_page == "Admin":
        admin_login()
if __name__ == "__main__":
    main()
